CREATE TABLE `manager_account` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '流水號',
  `UUID` varchar(32) NOT NULL COMMENT 'UUID',
  `ACCOUNT` varchar(15) NOT NULL COMMENT '帳號',
  `PASSWORD` varchar(15) NOT NULL COMMENT '密碼',
  `NAME` varchar(45) NOT NULL COMMENT '姓名',
  `DEPT_NO` varchar(5) NOT NULL COMMENT '部門代號',
  `DEPT_NAME` varchar(50) NOT NULL COMMENT '部門名稱',
  `UNIT_NO` varchar(8) DEFAULT NULL COMMENT '單位代號',
  `UNIT_NAME` varchar(50) DEFAULT NULL COMMENT '單位名稱',
  `EMAIL` varchar(100) NOT NULL COMMENT '信箱',
  `COMPANY_NO` varchar(2) NOT NULL COMMENT '公司別',
  `IDENTITY_ID` bigint(20) NOT NULL COMMENT '身份流水號',
  `STATUS` tinyint(4) NOT NULL COMMENT '帳號狀態(0：關閉，1：開啟)',
  `CREATE_BY` varchar(15) NOT NULL COMMENT '創建者',
  `CREATE_TIME` datetime NOT NULL COMMENT '創建時間',
  `UPDATE_BY` varchar(15) DEFAULT NULL COMMENT '編輯者',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '編輯時間',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=65 DEFAULT CHARSET=utf8mb4;
