-- Table structure for table `proposition`
--

DROP TABLE IF EXISTS `proposition`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `proposition` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '流水號',
  `UUID` varchar(32) NOT NULL COMMENT 'UUID',
  `CONTRACT_ID` varchar(11) DEFAULT NULL COMMENT '合約流水號',
  `PROPOSITION_NUMBER` varchar(15) DEFAULT NULL COMMENT '命題編號',
  `NAME` varchar(50) DEFAULT NULL COMMENT '名稱',
  `EDUCATION_ID` bigint(20) NOT NULL COMMENT '學制流水號',
  `SUBJECT_ID` bigint(20) NOT NULL COMMENT '學科流水號',
  `COURSE_LENGTH` int(11) DEFAULT NULL COMMENT '教學時間',
  `AUTHOR` varchar(45) DEFAULT NULL COMMENT '設計者',
  `AUTHOR_SCHOOL` varchar(45) DEFAULT NULL COMMENT '設計者學校',
  `PROOFREADER` varchar(45) DEFAULT NULL COMMENT '指導者',
  `LITERACY` longtext COMMENT '核心素養',
  `CONTENT` longtext COMMENT '學習內容',
  `PERFORMANCE` longtext COMMENT '學習表現',
  `GOAL` longtext COMMENT '學習目標',
  `TEXT` longtext COMMENT '試題文本',
  `QUESTION` longtext COMMENT '題目(題幹敘述)',
  `QUESTION_NO` int(11) DEFAULT NULL COMMENT '題號',
  `QUESTION_TYPE` tinyint(4) DEFAULT NULL COMMENT '題型(1：選擇題，2：混合題)',
  `QUESTION_CATEGORY` varchar(30) DEFAULT NULL COMMENT '題類',
  `SUBJECT` varchar(45) DEFAULT NULL COMMENT '學習科目',
  `SITUATION` longtext COMMENT '情境範疇',
  `ISSUE` longtext COMMENT '議題範疇',
  `SOURCE` longtext COMMENT '資料來源(引用出處)',
  `WHY` longtext COMMENT '取材說明(WHY)',
  `DISPLAY` tinyint(4) DEFAULT '1' COMMENT '前台顯示(0：不顯示，1：顯示)',
  `TAG` varchar(400) DEFAULT NULL COMMENT '關鍵字',
  `CTR` int(11) DEFAULT '0' COMMENT '點擊率',
  `AUDITOR` varchar(50) NOT NULL COMMENT '審核人(校長)',
  `AUDITOR2` varchar(50) DEFAULT NULL COMMENT '審核人(審議委員)',
