DROP TABLE IF EXISTS `school_master`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `school_master` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '流水號',
  `UUID` varchar(32) NOT NULL COMMENT 'UUID',
  `TYPE` tinyint(4) NOT NULL COMMENT '學制(1：國小、2：國中、3：高中、4：大專院校)',
  `CODE` varchar(10) DEFAULT NULL COMMENT '代碼',
  `NAME` varchar(25) NOT NULL COMMENT '名稱',
  `SCHOOL_TYPE` tinyint(4) NOT NULL COMMENT '公/私立(1：公立，2：私立)',
  `COUNTRY_NAME` varchar(10) NOT NULL COMMENT '縣市名稱',
  `ADDRESS` varchar(50) NOT NULL COMMENT '地址',
  `TELPHONE` varchar(25) NOT NULL COMMENT '電話',
  `WEBSITE` varchar(100) NOT NULL COMMENT '網址',
  `SYSTEM_TYPE` tinyint(4) DEFAULT NULL COMMENT '體系別(0：無、1：一般、2：技職、3：師範)',
  `DISPLAY` tinyint(4) NOT NULL COMMENT '顯示(0：否，1：是)',
  `CREATE_BY` varchar(15) NOT NULL COMMENT '創建者',
  `CREATE_TIME` datetime NOT NULL COMMENT '創建時間',
  `UPDATE_BY` varchar(15) DEFAULT NULL COMMENT '編輯者',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '編輯時間',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=4039 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

